        "description": "Workload Migration Program will securely configure the cloud environment and migrate all of Tunney's Pasture Data Center workloads.  This will provide Statistics Canada with the ability to rapidly scale computational resources for those workloads according to needs.The workload migration will also migrate Shared Services Canada's Foundational Services to the Borden Enterprise Data Center.  Together, this will allow the closure of the legacy aging Tunney's Pasture Data Center and the sustainment of the workloads. The project has three main components to meet its objectives. The first is the set up of the secure cloud environment required to operate Statistics Canada's business within a cloud environment. The second component is the migration of Statistics Canada's current workloads found in the Tunney's Pasture Data Center to the secure cloud environment. The third is the migration of the Foundational Services supported by Shared Services Canada to the Borden Enterprise Data Center. This allows Statistics Canada to take advantage of the benefits that a cloud environment provides users on rapid scaling and provisioning of Cloud computational resources. This is a cornerstone that allows the department to further it capabilities in data and analytics. The Government of Canada will also be able to consolidate its data center managed solutions to obtain operational efficiencies.",
