        "department": "Public Safety Canada",
        "projectName": "GCDOCS",
        "description": "PS adopted RDIMS as the mandatory corporate (up to Protected B) central repository in 2011 and migrated from RDIMS to GCDOCS on the secret network in 2018. The department is now preparing to migrate from RDIMS to GCDOCS on the corporate network. The plan is to fully implement GCDOCS in the departmentally assigned Azure (MSFT) environment (provided by Shared Services Canada) by July 2022. While implementing GCDOCS, we are also planning a phased-in approach for RDIMS migration to GCDOCS, starting with active documents, then legacy ones. During the implementation of GCDOCS and migration from RDIMS, PS employees will continue to have Read-Only access to RDIMS until all documents have successfully migrated.  The implementation of GCDOCS at PS will be on Premise (not through Public Service and Procurement Canada managed service) and is expected to be on Cloud Azure. GCDOCS, as it is currently with RDIMS, is deemed mission critical for PS and must have failover and disaster recovery (DR) sites to ensure its availability. The GCDOCS project started in October 2020. Information Management, with the help of consultants, have completed consultations with every business unit in the department and have developed a new functional based folder structure. PS has created a GCdocs solution in Smart UI and a direct integration with M365. Employees and consultants have been working on creating an enterprise GCDOCS solution in Azure Kubernetes container. We have also purchased DMZ servers to add functionality to GCDOCS including co-authoring.",
