        "projectName": "Transportation Security Clearance Modernization",
        "description": "The intent of the Transportation Security Clearance Modernization project is to support and improve service levels for Transport Canada\u2019s Security Screening Programs amidst the challenges of receiving increasingly higher volumes of service requests requiring tedious manual data validation, paper-based processes; an influx of temporary staff to clear backlogs; an unstable system and aging technology. The Transportation Security Clearance Modernization project consists of five inter-related initiatives which help to respond to these challenges by: 1) digitizing the Transport Canada Security Clearance Application and adding the capability to upload documents, reducing the need for manual validation, mail-in and matching application to documents, reducing the environmental impact of printing and storing paper; and creating a common component for any project using DocumentUpload; 2) upgrading aging technology for the Transport Canada Automated Fingerprinting Information System which collects, exchanges and stores biometric data, a key input for security screening; 3) stabilizing the new decision support tool (Vault) which is experiencing Severity 1 issues since its launch to production in August 2021; improving the overall system\u2019s performance by automating manual processes and developing detailed reporting capabilities; 4) delivering a service blueprint and an online service portal concept; and 5) conducting an in-depth analysis and recommendations on policy changes and performance measures which provide potential to further improve service levels.",
